import React from 'react';

function FunctionClick() {
	function clickHandler() {
		// console.log('Button Clicked');
		localStorage.clear();
	}
	return (
		<div>
			<button onClick={clickHandler}>Close Doorss</button>
		</div>
		)
}

export default FunctionClick

